import React from 'react';
import { Grid, Paper, Typography, Table, TableBody, TableCell, TableHead, TableRow, Box } from '@mui/material';
import { PieChart, Pie, Cell, ResponsiveContainer, Legend, Tooltip } from 'recharts';

const Devices = () => {
  const devices = [
    { name: 'Firewall', type: 'Network Security', status: 'Active', ip: '192.168.1.1' },
    { name: 'Switch', type: 'Network Device', status: 'Active', ip: '192.168.1.2' },
    { name: 'Windows Server', type: 'Server', status: 'Active', ip: '192.168.1.3' },
    { name: 'Endpoint 1', type: 'Workstation', status: 'Active', ip: '192.168.1.4' },
    { name: 'Endpoint 2', type: 'Workstation', status: 'Active', ip: '192.168.1.5' },
  ];

  // Calculate device status data for pie chart
  const statusCount = devices.reduce((acc, device) => {
    acc[device.status] = (acc[device.status] || 0) + 1;
    return acc;
  }, {});

  const statusData = [
    { name: 'Active', value: statusCount['Active'] || 0, color: '#4CAF50' },
    { name: 'Inactive', value: statusCount['Inactive'] || 0, color: '#FF5252' }
  ];

  return (
    <Grid container spacing={3}>
      <Grid item xs={12}>
        <Typography variant="h4" gutterBottom>Devices</Typography>
      </Grid>

      {/* Device Status Pie Chart */}
      <Grid item xs={12}>
        <Paper sx={{ 
          p: 2, 
          display: 'flex', 
          flexDirection: 'column', 
          alignItems: 'center',
          mb: 3 
        }}>
          <Typography variant="h6" gutterBottom>Device Status Overview</Typography>
          <Box sx={{ width: '100%', height: 300 }}>
            <ResponsiveContainer>
              <PieChart>
                <Pie
                  data={statusData}
                  cx="50%"
                  cy="50%"
                  innerRadius={60}
                  outerRadius={80}
                  paddingAngle={5}
                  dataKey="value"
                >
                  {statusData.map((entry, index) => (
                    <Cell key={`cell-${index}`} fill={entry.color} />
                  ))}
                </Pie>
                <Tooltip />
                <Legend verticalAlign="bottom" height={36} />
              </PieChart>
            </ResponsiveContainer>
          </Box>
        </Paper>
      </Grid>

      {/* Devices Table */}
      <Grid item xs={12}>
        <Paper sx={{ p: 2 }}>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>Device Name</TableCell>
                <TableCell>Type</TableCell>
                <TableCell>Status</TableCell>
                <TableCell>IP Address</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {devices.map((device) => (
                <TableRow key={device.name}>
                  <TableCell>{device.name}</TableCell>
                  <TableCell>{device.type}</TableCell>
                  <TableCell>{device.status}</TableCell>
                  <TableCell>{device.ip}</TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </Paper>
      </Grid>
    </Grid>
  );
};

export default Devices;
